import React from 'react';
import { useLanguage } from '../context/LanguageContext';

const Experience = () => {
  const { language } = useLanguage();

  const content = {
    tr: {
      education: {
        title: 'Eğitim',
        items: [
          {
            school: 'Yaşar Üniversitesi',
            date: '2017 - 2022',
            degree: 'Yazılım Mühendisliği',
            description: '3.57 GPA ile mezun oldum. Veri yapıları, algoritma analizi, yazılım mimarisi ve web teknolojileri üzerine kapsamlı eğitim aldım. Bitirme projemde IoT cihazları için gerçek zamanlı veri analizi platformu geliştirdim.'
          },
          {
            school: 'Warsaw University of Technology',
            date: '2021 - 2022',
            degree: 'Elektronik ve Bilgi Teknolojileri (Erasmus Programı)',
            description: 'Erasmus programı kapsamında bir dönem boyunca gömülü sistemler, IoT ve ağ teknolojileri üzerine çalışmalar yaptım. Uluslararası bir ekiple IoT tabanlı akıllı ev sistemi projesi geliştirdim.'
          }
        ]
      },
      experience: {
        title: 'İş Deneyimi',
        items: [
          {
            company: 'Simply Deliver',
            date: '2022 - Devam Ediyor',
            position: 'Back End Developer',
            responsibilities: [
              'Oracle Apex ve PL/SQL kullanarak web uygulamaları geliştirme',
              'Postman ile API testleri ve geliştirme',
              'RESTful servisler ile mobil tarafla JSON veri alışverişi',
              'Oracle Apex workplace\'te JavaScript kullanımı',
              'Jira ile proje yönetimi',
              'Agile/Scrum metodolojileri ile çalışma'
            ]
          },
          {
            company: 'Eralp Software',
            date: '2022',
            position: 'Part-Time Front End Developer',
            responsibilities: [
              'Web ve mobil uygulamalar için UI/UX tasarımcıları ile çalışma',
              'Vue.js ile Noteballs Web Uygulaması geliştirme',
              'Flutter ile geliştirilen ve Google Play Market\'te yayınlanan Arya Mobil Uygulamasının kod aşamasında aktif rol alma'
            ]
          },
          {
            company: 'Dijisan',
            date: '2021',
            position: 'Stajyer',
            responsibilities: [
              'Dashboard tasarımı ve geliştirme',
              'PHP ve MySQL veritabanları ile çalışma',
              'Node.js ile web tabanlı uygulama geliştirme'
            ]
          }
        ]
      }
    },
    en: {
      education: {
        title: 'Education',
        items: [
          {
            school: 'Yasar University',
            date: '2017 - 2022',
            degree: 'Software Engineering',
            description: 'Graduated with a 3.57 GPA. Received comprehensive training in data structures, algorithm analysis, software architecture, and web technologies. Developed a real-time data analysis platform for IoT devices as my graduation project.'
          },
          {
            school: 'Warsaw University of Technology',
            date: '2021 - 2022',
            degree: 'Electronics and Information Technology (Erasmus Program)',
            description: 'Studied embedded systems, IoT, and network technologies during one semester through the Erasmus program. Developed an IoT-based smart home system project with an international team.'
          }
        ]
      },
      experience: {
        title: 'Work Experience',
        items: [
          {
            company: 'Simply Deliver',
            date: '2022 - Present',
            position: 'Back End Developer',
            responsibilities: [
              'Developing web applications using Oracle Apex and PL/SQL',
              'Active use of Postman for API testing and development',
              'Communication with mobile side using RESTful services for JSON data exchange',
              'Using JavaScript in Oracle Apex workplace',
              'Active use of Jira for project management',
              'Working with Agile/Scrum methodologies'
            ]
          },
          {
            company: 'Eralp Software',
            date: '2022',
            position: 'Part-Time Front End Developer',
            responsibilities: [
              'Working with UI/UX designers for Web and mobile applications',
              'Developing Noteballs Web Application with Vue.js',
              'Played an active role in the code phase of the Arya Mobile Application developed in Flutter and released to Google Play Market'
            ]
          },
          {
            company: 'Dijisan',
            date: '2021',
            position: 'Intern',
            responsibilities: [
              'Designing and developing a simple website (Dashboard)',
              'Working with PHP and MySQL Databases',
              'Developing a web-based application with Node.js'
            ]
          }
        ]
      }
    }
  };

  const currentContent = content[language];

  return (
    <>
      <section id="egitim" className="section">
        <h2>{currentContent.education.title}</h2>
        {currentContent.education.items.map((item, index) => (
          <div key={index} className="education-item">
            <h3>{item.school}</h3>
            <p className="date">{item.date}</p>
            <p>{item.degree}</p>
            <p>{item.description}</p>
          </div>
        ))}
      </section>

      <section id="deneyim" className="section">
        <h2>{currentContent.experience.title}</h2>
        {currentContent.experience.items.map((item, index) => (
          <div key={index} className="experience-item">
            <h3>{item.company}</h3>
            <p className="date">{item.date}</p>
            <p>{item.position}</p>
            <ul>
              {item.responsibilities.map((resp, idx) => (
                <li key={idx}>{resp}</li>
              ))}
            </ul>
          </div>
        ))}
      </section>
    </>
  );
};

export default Experience;
